import{_ as t,c as a,o as i,ag as o}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP TRIGGER","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_TRIGGER.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_TRIGGER.md"}'),s={name:"docs/7x/ref_guide/sql_commands/DROP_TRIGGER.md"};function n(r,e,l,d,c,p){return i(),a("div",null,e[0]||(e[0]=[o('<h1 id="drop-trigger" tabindex="-1">DROP TRIGGER <a class="header-anchor" href="#drop-trigger" aria-label="Permalink to &quot;DROP TRIGGER&quot;">​</a></h1><p>Removes a trigger.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TRIGGER [IF EXISTS] &lt;name&gt; ON &lt;table&gt; [CASCADE | RESTRICT]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP TRIGGER</code> will remove an existing trigger definition. To run this command, the current user must be the owner of the table for which the trigger is defined.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the trigger does not exist. A notice is issued in this case.</p><p>name : The name of the trigger to remove.</p><p>table : The name (optionally schema-qualified) of the table for which the trigger is defined.</p><p>CASCADE : Automatically drop objects that depend on the trigger.</p><p>RESTRICT : Refuse to drop the trigger if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the trigger <code>sendmail</code> on table <code>expenses</code>;</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TRIGGER sendmail ON expenses;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The <code>DROP TRIGGER</code> statement in WarehousePG is not compatible with the SQL standard. In the SQL standard, trigger names are not local to tables, so the command is simply <code>DROP TRIGGER name</code>.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_TRIGGER.html">ALTER TRIGGER</a>, <a href="./CREATE_TRIGGER.html">CREATE TRIGGER</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',20)]))}const g=t(s,[["render",n]]);export{m as __pageData,g as default};
